import React, { useState } from 'react';
import './index.css';

// Header
const Header = () => (
  <header className="bg-gradient-to-r from-slate-100 to-slate-50 py-12 shadow-sm border-b">
    <div className="container mx-auto px-4 text-center">
      <h1 className="text-5xl font-extrabold tracking-tight text-gray-900">
        Deepfake Detection System
      </h1>
      <p className="mt-4 text-lg text-gray-600 max-w-2xl mx-auto">
        AI-powered video analysis to detect manipulated content.
      </p>
    </div>
  </header>
);

// Footer
const Footer = () => (
  <footer className="bg-white/70 backdrop-blur-xl text-gray-500 py-8 mt-16 border-t">
    <div className="container mx-auto px-4 text-center">
      <p className="text-sm">ƒê·ªì √°n nghi√™n c·ª©u ph√°t hi·ªán Deepfake Video</p>
      <p className="text-sm mt-1">
        ¬© <span className="text-gray-700 font-semibold">Nguy·ªÖn D∆∞∆°ng Minh Quan - 2251012119</span>
      </p>
    </div>
  </footer>
);

// Method Selector
const MethodSelector = ({ method, setMethod }) => {
  const descriptions = {
    'method-a': 'üìå Ph∆∞∆°ng ph√°p A ‚Äì Frame-wise Baseline: √Åp d·ª•ng m√¥ h√¨nh patch-based ƒë·ªÉ d·ª± ƒëo√°n t√≠nh th·∫≠t/gi·∫£ c·ªßa t·ª´ng khung h√¨nh ƒë·ªôc l·∫≠p.',
    'method-b': 'üó≥Ô∏è Ph∆∞∆°ng ph√°p B ‚Äì Voting theo th·ªùi gian: K·∫øt h·ª£p k·∫øt qu·∫£ nhi·ªÅu khung h√¨nh li√™n ti·∫øp qua voting ƒë·ªÉ ·ªïn ƒë·ªãnh v√† gi·∫£m nhi·ªÖu.',
    'method-c': 'üß© Ph∆∞∆°ng ph√°p C ‚Äì Feature Aggregation + MLP: Tr√≠ch xu·∫•t ƒë·∫∑c tr∆∞ng CNN, t·ªïng h·ª£p (mean pooling) v√† ph√¢n lo·∫°i b·∫±ng MLP.',
    'method-d': 'üöÄ Ph∆∞∆°ng ph√°p D ‚Äì M√¥ h√¨nh ƒë·ªÅ xu·∫•t: K·∫øt h·ª£p ƒë·∫∑c tr∆∞ng patch-level v·ªõi LSTM/Transformer ƒë·ªÉ h·ªçc c·∫£ kh√¥ng gian v√† th·ªùi gian.'
  };

  return (
    <div className="bg-white/70 backdrop-blur-xl p-8 rounded-3xl shadow-[0_8px_30px_rgb(0,0,0,0.08)] transition-all duration-300">
      <h2 className="text-2xl font-bold mb-6 text-gray-900">‚ö° Ch·ªçn Ph∆∞∆°ng ph√°p</h2>
      <select
        id="analysis-method"
        className="w-full p-4 border border-gray-200 rounded-2xl text-lg bg-white/70 backdrop-blur-sm focus:outline-none focus:ring-2 focus:ring-blue-500 transition"
        value={method}
        onChange={(e) => setMethod(e.target.value)}
      >
        <option value="method-a">Ph∆∞∆°ng ph√°p A ‚Äì Frame-wise Baseline</option>
        <option value="method-b">Ph∆∞∆°ng ph√°p B ‚Äì Voting theo th·ªùi gian</option>
        <option value="method-c">Ph∆∞∆°ng ph√°p C ‚Äì Feature Aggregation + MLP</option>
        <option value="method-d">Ph∆∞∆°ng ph√°p D ‚Äì M√¥ h√¨nh ƒë·ªÅ xu·∫•t</option>
      </select>
      <div className="mt-6 bg-gradient-to-r from-blue-50 to-indigo-50 p-6 rounded-2xl border border-gray-100">
        <p className="text-gray-700 leading-relaxed">{descriptions[method]}</p>
      </div>
    </div>
  );
};

// Upload Form
const UploadForm = ({ file, loading, handleSubmit, handleFileChange }) => (
  <div className="bg-white/70 backdrop-blur-xl p-8 rounded-3xl shadow-[0_8px_30px_rgb(0,0,0,0.08)]">
    <h2 className="text-2xl font-bold mb-6 text-gray-900">üì§ Upload Video</h2>
    <form onSubmit={handleSubmit} className="space-y-6">
      <label
        htmlFor="video-file"
        className="flex flex-col items-center justify-center p-10 border-2 border-dashed border-gray-300 rounded-2xl bg-white/50 text-gray-500 cursor-pointer hover:border-blue-500 hover:bg-blue-50 transition"
      >
        <span className="text-gray-700 font-medium">K√©o & th·∫£ video</span>
        <span className="text-sm">ho·∫∑c nh·∫•p ƒë·ªÉ ch·ªçn t·ªáp</span>
        <input type="file" id="video-file" className="hidden" accept="video/*" onChange={handleFileChange} />
      </label>

      {file && (
        <div className="text-gray-600 text-center text-sm">
          üìÇ <strong>{file.name}</strong> ({(file.size / 1024 / 1024).toFixed(2)} MB)
        </div>
      )}

      <button
        type="submit"
        className={`w-full py-4 px-6 rounded-2xl font-semibold text-lg transition-all duration-300 ${
          loading || !file
            ? 'bg-gray-300 text-gray-500 cursor-not-allowed'
            : 'bg-gradient-to-r from-blue-600 to-indigo-700 text-white shadow-lg hover:scale-105 hover:shadow-2xl'
        }`}
        disabled={loading || !file}
      >
        {loading ? '‚è≥ ƒêang ph√¢n t√≠ch...' : 'üöÄ Ph√¢n t√≠ch'}
      </button>
    </form>
  </div>
);

// Loading Spinner
const LoadingSpinner = () => (
  <div className="flex flex-col items-center justify-center py-12">
    <div className="w-16 h-16 border-4 border-gray-200 border-t-blue-500 rounded-full animate-spin"></div>
    <p className="mt-4 text-gray-600 font-medium">ƒêang x·ª≠ l√Ω video...</p>
  </div>
);

// Result
const ResultDisplay = ({ result, processingTime }) => {
  if (!result) return null;
  const isFake = result.is_fake;
  const confidence = (result.confidence * 100).toFixed(2);

