// App
const App = () => {
  const [method, setMethod] = useState('method-a');
  const [file, setFile] = useState(null);
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);
  const [processingTime, setProcessingTime] = useState(0);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
    setResult(null);
    setProcessingTime(0);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setResult(null);
    const startTime = Date.now();

    await new Promise((resolve) => setTimeout(resolve, 3000));

    const isFake = Math.random() > 0.5;
    const confidence = Math.random();
    setResult({ is_fake: isFake, confidence });
    const endTime = Date.now();
    setProcessingTime(((endTime - startTime) / 1000).toFixed(2));
    setLoading(false);
  };

  return (
    <div className="min-h-screen flex flex-col bg-gradient-to-br from-gray-50 to-gray-100 font-sans">
      <Header />
      <main className="flex-1 py-16 px-6 flex justify-center items-start">
        <div className="container mx-auto max-w-5xl">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-10">
            <MethodSelector method={method} setMethod={setMethod} />
            <UploadForm file={file} loading={loading} handleFileChange={handleFileChange} handleSubmit={handleSubmit} />
          </div>
          {loading && <LoadingSpinner />}
          {result && <ResultDisplay result={result} processingTime={processingTime} />}
        </div>
      </main>
      <Footer />
    </div>
  );
};

export default App;
